import React from "react";
import s from "./header.module.css";
import { UilBell, UilMessage, UilSetting, UilUser } from "@iconscout/react-unicons";

export const Header = () => {
  return (
    <header className={s.headerWrapper}>
      <div className={s.leftContainer}>
        <div>Logo</div>
        <div>
          <input type="text" placeholder="Start typing t"/>
        </div>
      </div>
      <div className={s.rightContainer}>
          <UilBell />
          <UilMessage />
          <UilSetting />
          <UilUser />
      </div>
    </header>
  );
};
